static inline bool
is_pseudo_target(int pseudo, int target) {
    if (pseudo < 256 || pseudo >= 268) {
        return false;
    }
    for (int i = 0; pseudo_targets[pseudo-256].targets[i]; i++) {
        if (pseudo_targets[pseudo-256].targets[i] == target) return true;
    }
    return false;
}

